 var app = angular.module('CatanBoardGenerator', []);

	app.controller('MainController', function($scope) {
	 	
	 	/* Game Config */
	 	$scope.game = {
	 		type: 'normal',
	 		tiles: [],
	 		name: "",
	 		cards: {
	 			'brick':15,
	 			'ore':15,
	 			'wheat':20,
	 			'sheep':20,
	 			'wood':20
	 		},
	 		misc: {
	 			largestArmy:1,
	 			longestRoad:1,
	 			buildingCost:4
	 		}
	 	}

	 	/* Defines the starting tab */
	 	$scope.tab = 'board';

	 	/* Different token maps */
	 	$scope.normalTokens = {
	 		'0': 5,
	 		'1': 2,
	 		'2': 6,
	 		'3': 8,
	 		'4': 3,
	 		'5': 10,
	 		'6': 9,
	 		'7': 12,
	 		'8': 11,
	 		'9': 4,
	 		'10': 8,
	 		'11': 10,
	 		'12': 9,
	 		'13': 4,
	 		'14': 5,
	 		'15': 6,
	 		'16': 3,
	 		'17': 11,}
	 	$scope.expansionTokens = {
	 		'A': 2,
	 		'B': 5,
	 		'C': 4,
	 		'D': 6,
	 		'E': 3,
	 		'F': 9,
	 		'G': 8,
	 		'H': 11,
	 		'I': 11,
	 		'J': 10,
	 		'K': 6,
	 		'L': 3,
	 		'M': 8,
	 		'N': 4,
	 		'O': 8,
	 		'P': 10,
	 		'Q': 11,
	 		'R': 12,
	 		'T': 5,
	 		'V': 9,
	 		'W': 5,
	 		'X': 9,
	 		'Y': 12,
	 		'Za': 3,
	 		'Zb': 2,
	 		'Zc': 6,}
	 	$scope.seafarerTokens = {};
	 	$scope.citiesAndKnights = {};

	 	/* Generate the deck */
	 	$scope.generateTiles = function() {
	 		console.log("**** Generate Tiles ****");
	 		if($scope.game.type == 'normal') {
	 			$scope.addTile(4,'wood');
	 			$scope.addTile(4,'sheep');
	 			$scope.addTile(4,'wheat');
	 			$scope.addTile(3,'ore');
	 			$scope.addTile(3,'brick');
	 			$scope.addTile(1,'desert');

	 			$scope.scrambleTiles();

	 			console.log($scope.game);
	 		}
	 		else if ($scope.game.type == 'expansion'){

	 		}
	 		else {

	 		}

	 		$scope.setTiles();
	 	}

	 	/* Add tiles to the deck*/
	 	$scope.addTile = function(count,resource) {
	 		for (var x = 0;x<count;x++) {
	 			$scope.game.tiles.push({'resource':resource});
	 		}
	 	}

	 	/* Scramble the tiles */
	 	$scope.scrambleTiles = function() {
	 		console.log("**** Scramble Tiles ****")
		    for (var i = $scope.game.tiles.length - 1; i > 0; i--) {
		        var j = Math.floor(Math.random() * (i + 1));
		        var temp = $scope.game.tiles[i];
		        $scope.game.tiles[i] = $scope.game.tiles[j];
		        $scope.game.tiles[j] = temp;
		    }
	 	}
	 	
	 	/* Generate the board */
	 	$scope.setTiles = function() {
	 		console.log("**** setTiles ****");
	 		$scope.token = [];
	 		var tokenCounter = 0;
	 		for (tile in $scope.game.tiles) {

	 			var tileElement = angular.element( document.querySelector('#tile' + tile));

	 			if($scope.game.tiles[tile].resource == "wheat"){
	 				tileElement.css('background-image','url("resources/wheat.png")'); 
	 				$scope.token[tile] = $scope.normalTokens[tokenCounter];
	 			}
	 			else if($scope.game.tiles[tile].resource == "brick"){
	 				tileElement.css('background-image','url("resources/brick.png")'); 
	 				$scope.token[tile] = $scope.normalTokens[tokenCounter];
	 			}
	 			else if($scope.game.tiles[tile].resource == "wood"){
	 				tileElement.css('background-image','url("resources/wood.png")'); 
	 				$scope.token[tile] = $scope.normalTokens[tokenCounter];
	 			}
	 			else if($scope.game.tiles[tile].resource == "sheep"){
	 				tileElement.css('background-image','url("resources/sheep.png")'); 
	 				$scope.token[tile] = $scope.normalTokens[tokenCounter];
	 			}
	 			else if($scope.game.tiles[tile].resource == "ore"){
	 				tileElement.css('background-image','url("resources/ore.png")'); 
	 				$scope.token[tile] = $scope.normalTokens[tokenCounter];
	 			}
	 			else if($scope.game.tiles[tile].resource == "desert"){
	 				tileElement.css('background-image','url("resources/desert.png")'); 
	 				$scope.token[tile] = 'Desert';
	 				tokenCounter = tokenCounter - 1//Do not increment the tile number
	 			}
	 			else {
	 				console.log("Error");
	 			}
	 			tokenCounter++;
	 		}
	 	}

	 	/* Print the board */
	 	$scope.generateBoard = function(divID) {
			  var printContents = document.getElementById(divID).innerHTML;
			  var popupWin = window.open('', '_blank', 'width=700px,height=500px');
			  popupWin.document.open();
			  popupWin.document.write('<html><head><link rel="stylesheet" type="text/css" href="css/main.css" /></head><body onload="window.print()">' + printContents + '<script>setTimeout(function(){}, 2000);</script></body></html>');
			  popupWin.document.close();
		} 

		/* Generate the card pdf */
		$scope.generateCards = function() {
			var doc = new jsPDF();

			var resourceTypes = ['brick','wheat','ore','sheep','wheat'];

			/*These are really long strings */
		 	var dataURI = {
		 		'brick' : 'data:image/png;base64,',
				'wood' : 'data:image/png;base64,',
				'sheep' : 'data:image/png;base64,',
				'ore' : 'data:image/png;base64,',
				'wheat' : 'data:image/png;base64,',
		 	}
			
			for (resource in resourceTypes) {
				addCards(resourceTypes[resource]);
				doc.addPage();
			}
			
			if($scope.game.name == ""){
				doc.save('Catan-cards.pdf');
			}
			else {
				doc.save($scope.game.name + '-cards.pdf');
			}

			function addCards(type) {
				var initialX = 15;
				var initialY = 15;
				var width = 60;
				var height = 80;

				for(var x=1;x <= $scope.game.cards[type];x++) {
					doc.addImage(dataURI[type], 'PNG', initialX,initialY,width,height);
					initialX = initialX + width;
					if(x % 3 == 0){
						initialX = 15;
						initialY = initialY + 80;
					}
					if(x % 9 == 0){
						doc.addPage();
						initialX = 15;
						initialY = 15;
					}
				}
			}
		}

		/* Generate the misc pdf */
		$scope.generateMisc = function() {
			var doc = new jsPDF();

			var miscTypes = ['longestRoad','largestArmy','buildingCost'];

			var dataURI = {
				'largestArmy': 'data:image/png;base64,',
				'longestRoad': 'data:image/png;base64,',
				'buildingCost': 'data:image/png;base64,'
			}

			for (misc in miscTypes) {
				addCards(miscTypes[misc]);
				doc.addPage();
			}
			
			if($scope.game.name == ""){
				doc.save('Catan-misc.pdf');
			}
			else {
				doc.save($scope.game.name + '-misc.pdf');
			}

			function addCards(type) {
				var initialX = 15;
				var initialY = 15;
				var width = 60;
				var height = 80;

				for(var x=1;x <= $scope.game.misc[type];x++) {
					doc.addImage(dataURI[type], 'PNG', initialX,initialY,width,height);
					initialX = initialX + width;
					if(x % 3 == 0){
						initialX = 15;
						initialY = initialY + 80;
					}
					if(x % 9 == 0){
						doc.addPage();
						initialX = 15;
						initialY = 15;
					}
				}
			}
		}


		$scope.generateTiles();
	});
